script: |
  super -f text -I q3509.spq | sort > q3509.out

inputs:
  - name: q3509.spq
    data: |
      SELECT ALL ( - 86 ) / cor1.col2 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0

outputs:
  - name: q3509.out
    data: |
      -1
      -1
      -1
      -2
      -2
      -2
      -86
      -86
      -86
